import styled from 'styled-components'

function AdminSidebar (props) {
    return(
        <SidebarWrapper>
                <sbTitle>ADMIN</sbTitle>
        </SidebarWrapper>
    );
}

const SidebarWrapper = styled.div`
    height: 100vh;
    width: 20vw;
    z-index: 5;
    background-color: #111;
    position: fixed;
    display: flex;
`;

const sbTitle = styled.h1`
    font-size: 32px;
`;

export default AdminSidebar;
